import logo from './logo.svg';
import './App.css';
// Single widget
import { Meeting } from '@iotum/callbridge-js';
import { useEffect } from 'react';

function newMeeting() {
  const widget = new Meeting({"domain":"iotum.callbridge.rocks","container":"#ifrm_container"}, 5821515, {"name":"Guest","view":"left_side_speaker","tiles":4,"resolution":180,"mute":{"mic":true,"camera":true}});
  return widget;
}

function App() {
  useEffect(() => {
    newMeeting();
  });
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React - Testing Widget
        </a>
      </header>
      <div id="ifrm_container"></div>
    </div>
  );
}

export default App;
